import React from 'react';
import '/home/moglix/Desktop/projectFrontend/my/src/Components/EmployeeComponent/EmployeeComponent.css';
import Popup from 'reactjs-popup';
import 'bootstrap/dist/css/bootstrap.min.css';
import{Alert,Button} from 'react-bootstrap';
import pic from './../../Assets/employee.png';

class Employee extends React.Component {
    constructor(props){
        super(props);
        this.state = {
            employee:[]
        }
      }
      componentDidMount()
      {
        fetch('https://mocki.io/v1/8b58f489-d1d2-4b4c-b2bd-02c0603c8112')
        .then(response => response.json())
        .then(result => {
            let tmpArray = []
            for (var i = 0; i < result.data.length; i++) {
                tmpArray.push(result.data[i])
            }
            this.setState({employee:tmpArray})
        })
        .catch(e => {
            console.log(e);
        });

      }
    render(){
       console.log(this.state.employee);

        return(
        <div>
            {/*----------------------Navbar----------------- */}

            <nav className="navbar navbar-expand-sm navbar-light bg-light">
            <a className="navbar-brand" href="https://www.moglix.com/" >
                <img src="https://cdn.moglix.com/assets/img/moglix-logo.jpg" id="logo"/></a>
            <ul className="navbar-nav">
                <li className="nav-item">
                    <a className="nav-link" href="#">
                      <h5>Dashboard</h5></a>
                </li>
                <li className="nav-item">
                    <a className="nav-link" href="#" style={{paddingLeft:"2"}}><h5>About</h5></a>
                </li>
            </ul>
        </nav><br />
         {/*----------------------Navbar Ends----------------- */}

         {/*---------------- Side Bar------------------- */}
        <div className="container-fluid">
            <div className="row">
                <div className="col-md-2">
                    <div className="card" id="mc">
                        <div className="card-body" id="maincard">
                        </div>
                    </div>
               </div>

        {/*----------Main Content------------------------ */}
                <div className="col-md-10 ">
                    <div className="card">
                        <div className="card-body">

</div>
</div><br/>
<div className="card">
<div className="row">

                        {this.state.employee.map((emp)=>(
                            <div className="col-sm">

                            <div className="card">
                               <div className="card-body">
                             <img src={pic} alt="..." style={{height:"100px"}} />
                            <h5 className="card-title empName" style={{textDecoration:"underline"}}>{emp.employeeName}</h5>
                             <p className="card-text">This is a longer card with supporting text below as a natural lead-in to additional content. This content is a little bit longer.</p>
                             <p className="card-text"><small className="text-muted">Last updated 3 mins ago</small></p>
                             </div>

                             </div>
                        </div>


                        ))}



                            </div>
                        </div>
                  </div>     









            </div>
        </div>

















        </div>
            );
    }
}
export default Employee;
